            myResult = @"Děti\tdítě\tNNFP1-----A----\npojedou\tjet-1_^(pohybovat_se,_ne_však_chůzí)\tVB-P---3F-AA---\nk\tk-1\tRR--3----------\nbabičce\tbabička\tNNFS3-----A----\n.\t.\tZ:-------------\n\n";
